import React from 'react';

const CommentCard = (comment) => {
  console.log(comment)
  return (
    <div>
      <li>
      <h3>
          {comment.author}
        </h3>
        <h4>
           {comment.body}
        </h4>
        <h5>
          published at: {comment.created_at}
        </h5>

      </li>
    </div>
  );
};

export default CommentCard;
